$GLOBALS["lang"]['<p><strong>Baseline</strong> - The overarching document that contains the baseline definition and the individual policy tests.<br> <br> <strong>Policies</strong> - The individual tests contained within a Baseline. Each test is for a specific item. An example would be testing for SSH version 1.2.3.<br> <br> <strong>Details</strong> - Baselines can compare netstat ports, users and software.<br> <br> <strong>Software</strong> - To compare software we check the name and version. Because version numbers are not all standardised in format, when we receive an audit result we create a new attribute called software_padded which we store in the database along with the rest of the software details for each package. For this reason, baselines using software policies will not work when run against a device that has not been audited by 1.10 (at least). Software policies can test against the version being "equal to", "greater than" or "equal to or greater than".<br> <br> <strong>Netstat Ports</strong> - Netstat Ports use a combination of port number, protocol and program. If all are present the policy passes.<br> <br> <strong>Users</strong> - Users work similar to Netstat Ports. If a user exists with a matching name, status and password details (changeable, expires, required) then the policy passes.<br> <br> </p>'] = '<p><strong>(1)</strong> (OL L 20, 2015.1 27, p. 42).<br/> <br/> <strong>Bendrijoje</strong> Indinfutuaj commersij enhavitaj ene de Bazlino. Mina sintoiu testo estetas por specia objectto. Ekzemplo estus testata pri SS- version 1.2.3.<br/> <br/> <strong>Bendrijoje</strong> Bazlinioj povas kompari need hasnojn, uzantojn kaj softvaron.<br/> <br/> <strong>Bendrijoje</strong> Por kompari softvaron ni controllas tendomon kaj versūne. Identificar versico nombroj nestas Tial, bazlinioj uzantaj softvarpolitikojn ne funkcias dum kuro kontra epäilty aparato kiu ne estis reviziita neestas 1.10 (almena kaptlus). Softvarpolitkoj povas testi kontrouna la verserio 