$GLOBALS["lang"]['<p>Credentials are encrypted when stored in the database.<br> <br>When a Discovery is run, a device has its credentials retrieved and tested for connection first (from the <code>credential</code> table). If these fail, then credentials associated with the given Org <code>credentials.org_id</code> is also tested against the device. Working credentials are stored at an individual device level in the credential table (note - no "s" in the table name).<br> <br>SSH keys are tested before SSH username / password. When testing SSH, credentials will also be marked as working with sudo or being root.<br> <br>For ease of use, Windows passwords should not contain a single or double quote. This is a remote WMI limitation, not an Open-AudIT limitation.<br> <br></p>'] = '<p>Bendrijoje <br/> <br/>Įžanginė pastaba... <code>credential</code> Bendrijoje Se tiuj malsukcesas, tiam akredita new... <code>credentials.org_id</code> Én ankaestas new kontra.<br/> <br/>SH- aprettosiloj estas estetaj Bendrijoje. Dum testado de SSH...<br/> <br/>Por membrieco neuzo, Fenestroj ne devus enhavi ununuran épäilty duoblan citaonon. Tio estas malpreksima WMI- limigo, Bendrijoje.<br/> <br/></p>';

