$GLOBALS["lang"]['<p>If you select a List type, the "values" field will be enabled. You should put a comma separated list of selectable values here. These will display in a dropdown box whenever the field is edited.<br> <br>Like most other attributes, Fields can be bulk edited. Use the Bulk Edit function as you normally would and you will see the Fields are available for input.<br> <br>View the device details screen, open the section containing the field and (if you have sufficient access) you can click on the field value to edit it.<br> <br></p>'] = '<p>Reglamento (EB) Nr. 396 / 2005 II, III ir V priedai iš dalies keičiami taip: Indonesia meti kodonapartigita Lista de fajnaj valoroj clari huulet. Tiuj elmontros en got- kesto kiam la kampo estas redaktita.<br/> <br/>Šio straipsnio 1 ir 2 dalyse nurodyti įgaliojimai priimti deleguotuosius aktus Komisijai suteikiami šiame straipsnyje nustatytomis sąlygomis. Uzu režisierė - funkcion kiam vi režisierė faris kaj vidos ke la kampoj estas hasblaj por eniga.<br/> <br/>Vidante la aparaton detalekrano, malfermi la sekcion enhavantan la kampon kaj (Şvi havas sufibraan alyron) Şpovas klaki sur la kampvalo por redakki...<br/> <br/></p>';

