$GLOBALS["lang"]['<p>Microsoft Windows desktop systems have network limitations that may impact the performance of Open-AudIT. The TCP/IP stack limits the number of simultaneous incomplete outbound TCP connection attempts. After the limit is reached, subsequent connection attempts are put in a queue and will be resolved at a fixed rate (10 per second). If too many enter the queue, they may be dropped. And finally, Apache will be restarted by the OS. For this reason, installing Open-AudIT on a Windows desktop operating system is not supported.<br><br>There is nothing wrong with the Open-AudIT code, nor can we do anything to address this issue on Windows client machines.'] = '<p>"La TCP" / "Ip- A"). kiam la limo estas atinita, postaj konektomedij estas metitaj enendovicon kaj estos solvitaj Bendrijoje Kajfinfinfinfinine, Indonesian Fare de la Os. Tial, instali Open- sur new - tabloé opracium ne estas apogita.<br/><br/>Bendrijoje</p>';

$GLOBALS["lang"]['<p>Nmap timing details are found on the bottom of this linked page <a href="https://nmap.org/book/man-performance.html" target="_blank">https://nmap.org/book/man-performance.html</a>. From that page:<br> <br><em>If you are on a decent broadband or ethernet connection, I would recommend always using -T4 (Aggressive). Some people love -T5 (Insane) though it is too aggressive for my taste. People sometimes specify -T2 (Polite) because they think it is less likely to crash hosts or because they consider themselves to be polite in general. They often do not realize just how slow -T2 really is. Their scan may take ten times longer than a default scan. Machine crashes and bandwidth problems are rare with the default timing options -T3 (Normal) and so I normally recommend that for cautious scanners. Omitting version detection is far more effective than playing with timing values at reducing these problems.</em><footer>Gordon <i>Fyodor</i> Lyon</footer><br> <br></p>'] = '<p>Nmap Tempigas detalojn estastrovitaj sur la fondo de tiuligita pacomamento <a href="https://nmap.org/book/man-performance.html" target="_blank">https: / / nmap.org / libro / uomo- rev. Bendrijoje</a>-<br/> <br/><em>Se vi estas sur deka gradidabendo a difetto tero ligo, mi remomendus ciiam uzi T4 (Agres). Kelkaj Bendrijoje - T5 ("T5") kvankam liquiciulici estos tro concordasema por mia gusto. ® ® ® ® ® ® ® ® LT ® ne ekkomprenas eksporte kiom malladrapa - T2 vere estas. Ilia sanado povas preni dek fojojn pli downe ol deva guidlta canado. Šis sprendimas įsigalioja jo priėmimo dieną. Uzanta verserio detekto estumes multe pli efika ol ludado kun tempigvaloroj "Reduktado de tiauj"</em><footer>C \'e\' "" "" "" "" "" "" "" "" "". <i>Bendrijoje</i> Bendrijoje</footer><br/> <br/></p>';

