$GLOBALS["lang"]['A virtual private network (VPN) is an overlay network in which some of the links between nodes are carried by open connections or virtual circuits in some larger network (e.g., the Internet) instead of by physical wires. The data link layer protocols of the virtual network are said to be tunneled through the larger network when this is the case. One common application is secure communications through the public Internet, but a VPN need not have explicit security features, such as authentication or content encryption. VPNs, for example, can be used to separate the traffic of different user communities over an underlying network with strong security features.<br><br>VPN may have best-effort performance, or may have a defined service level agreement (SLA) between the VPN customer and the VPN service provider. Generally, a VPN has a topology more complex than point-to-point.'] = 'Virtica privata reto (VPN) estas superlay reto en kiu kelkaj el ligi laloj inter nodoj estas portitaj per malfermaj ligoj a skepticaj cirkvitoj en iu pli granda reto (ekz., la Interreto) anstata guide de per fizikaj dratoj. ® datenligtavolo protokolas de la virtual retoa la guiddire estas Sellita tra la pli gra reto kiam tio estas la kazo. Unu ofta apliki suyas estas sekura kommunikado tra la publika interreto, sed VPN ne bezonas eksplicitaj n sekurectrajtojn, kiel ekimer konfirmo previsto. VPN ® ekimplementarum povas esti uzita por apartigi la trafikon de malsamaj uzantkomuniumoj Bendrijoje.<br/><br/>VPN ® povas havi plej bonan efikecon, epäilty povas havi difinitan serva nivelinterkonsenton (SLA) ŞBendrijoje VPN havas topologion pli kompleksan ol punkto- Bendrijoje.';

