$GLOBALS["lang"]['On Windows, Open-AudIT uses WMI as it is primary method of auditing. Windows has a notorious reputation where remote WMI is concerned. It tends to either <i>just work</i> or some mystery item on the target requires changing. If you are experiencing difficulty auditing remote Windows PCs, we have created a script called test_windows_client.vbs. You can run this script <strong>locally</strong> on the machine in question, after signing on as the user that is used by Open-AudIT to perform the audit. The script makes <strong>no changes</strong> to the target devices. It checks most (not all) of the items below and generates PASS, FAIL and INFO tags for various properties. NOTE - If your target system is being audited correctly, you should not change any settings. Some of the below do not exist on Windows PCs that are able to be audited and some do exist. Only change settings if your discoveries on particular PCs are not working as intended.'] = 'Sur Fenestroj, reviziado, - (arba) Fenestroj havas konatan reputazione kie malpreksima WMI estas maltrankvila Bendrijoje. "Kaldun Kaplustama" ("arba" arba "arba") <i>"Nincs"</i> Bendrijoje Se vi spertas malcomedicon reviziantan malpreksimajn Fenestrojn, ni kreis manikripton nomitan testwins _ Bendrijoje. Bendrijoje <strong>Bendrijoje</strong> En la ma apretino preockazioneita, tavia subskribado kiel la uzanto kiu estas utiligita Fare de open- Bendrijoje. (EB) Nr. 1235 / 2008 <strong>Bendrijoje</strong> 2005 m. sausio 1 d. Tarybos reglamentas (EB) Nr. 139 / 2005 dėl koncentracijų tarp įmonių kontrolės (OL L 10, 2006.1 11, p. 1). Kelkaj el la malsupre ne ekistas sur Fenestroj kiuj povas reviziitaj kaj kelkaj ekistas. Sur specialaj komputiloj ne funkcias Bendrijoje';

