$GLOBALS["lang"]['Once those initial queries (snmp, ssh, wmi) are complete, if the device is a supported by the audit scripts (Windows, Linux, OSX, AIX, HP-UX, Solaris and ESXi), the correct audit script will be copied to the target and executed. The audit script will self delete upon completion. The result will be stored on the target machine as an XML file. The Open-AudIT server will then retrieve the result file for processing and delete the result file on the target. The location the audit script is copied to on the target device (at least for SSH audits) is configurable by editing the discovery_linux_script_directory config item. By default it is set to /tmp/. This may need changing if /tmp has noexec set. The result file is then processed and the device details updated within Open-AudIT.'] = 'РАНАН tiaj omencaj esigeoj (snmp, ssh, wmi) estas kompletaj, se la aparato estas apogita per la reviziomanuskriptoj (Windows, Linukso, OsX, HP- UX, Solaris kaj ESXi), la εusta reviziomanusckita estos koopi La revizio manikripto mem foreigos sur kompletigos. Reglamento (EB) Nr. 396 / 2005 II, III ir V priedai iš dalies keičiami taip: ® ® ® ® ® ® ® - Servilo tiam prenos la rezultan dosieron por pretigo kaj forigi la rezultan dosieron sur la celo. La loko kiun la reviziomanuskripto estas kopita al sur la celaparato (almena support por SSH- revizioj) estas formita redactante la eltrova.o _ reviziomanuskripto estas kopita al sur la celaparato (almena support por SS- revizioj) estas formita redactante la eltrova.o _ reva.o _ revitul revisiziomanuskripto estan tun. L \'ution de l\' énergie nucléaire dans le secteur de l \'énergie et de l\' énergie, y communis l \'énergie et l\' énergie énergie Tio povas bezoni tlan rezulta dosiero tiam estas prilboreita kaj la aparato detaloj εisdatigitaj ene ľ@@';

$GLOBALS["lang"]['Once you click the execute button, Open-AudIT will spawn a process to initiate the discovery and return the user to the discovery details page. The newly spawned process takes the configured discovery options and executes Nmap commands to determine the initial list of IP addresses to be scanned (or queries Active Directory if that type is used). Each IP to be scanned is placed into a queue. Once the initial process has completed (and there are IPs to be scanned in the queue) a number of processes will be spawned to further scan each IP in parallel. This number of processes is configurable in the configuration, edit the attribute <i>queue_limit</i>. By default this is set to 20.'] = 'Įžanginė pastaba. Nmap komandojn por determini la omencan Listan de IP- adresoj por esti skanitaj (kahtlusega demandoj Active Directory se tu tipo estetas uzita). Imitu IP esti danita estas metita en atendovicon. kiam la omenca procezo kompletigis (kaj eksportas IPoj por etisti skanita en la atendovico) kelkaj procezoj estos generolaj al plu skana... Tiu nombro da procezoj estas konfumbla en la konfiguracio, redakki la svarstytina. <i>Järjekorra</i>. deca.lte to estas metita opharm 20.';

