$GLOBALS["lang"]['Open-AudIT Community source code is available on GitHub. You are encouraged to inspect any code you have concerns about, and because it is open source - you are also encouraged to ask us about any issues you have or report any findings. We are always more than happy to accept code contributions, vulnerability reports, or even simple questions. We are here to help.<br><br>The audit scripts themselves (Windows, Linux, MacOS, et al) are deliberately written in readable native shell script (VBScript for Windows, Bash for *nix). You can see exactly what commands are run. You can remove any commands you feel you do not need. You can ask a third party to inspect the code for you and (if you want to) report any findings.<br><br>Open-AudIT Enterprise performs the add-on commercial functions for Open-AudIT Community. It is included as a single compiled file with no external dependencies. Where Enterprise itself performs the function(s), if you are concerned with any issues Firstwave is happy to work through them with you - just ask! Try that with another commercial software vendor!'] = '® ® Komunuma fondkodo estas hasbla sur GitHub. Vi estas instigita por inspekti ajnan kodon kiun vi havas zorgojn pri, kaj clearfichari estas malferma fonto - vi anka. (OL L 20, 2015.1 27, p. 42). Bendrijoje Ni estas - rev.<br/><br/>La reviziomanuskriptoj mem (Windows, Linukso, MacOS, SmithKline) estas konscie skribitaj en legebla indi... ena рelmanökripto (VBScript por Fenestroj, Bash por nix). Thomas. Vio povas forigi jujn ordonojn, kiujn vi sendas, ke vi ne bezonas. Vi povas esigei al tria parto inspekti la kodon por vi kaj (se vi volas) raporti jojn ajn rezultojn.<br/><br/>"Environment" Le Conseil européen de Lisbonne adottié le rapport de la condition sur la mise en \'uvre de la stratégie de Lisbonne. English felivistea lapi kun vi - nur esigei! Prostitution kun alias Komerca Bendrijoje! -';

