$GLOBALS["lang"]['Open-AudIT has a powerful change detection engine. Any device attributes that are added, removed or changed will be detected and stored. These changes can be reported upon and the relevant data confirmed as to what was expected from your company change and release process.<br><br>When a device is audited, attributes are divided into sections which correspond to tables in the database.<br><br>Each device (computer, router, printer, et al) has an entry in the <code>devices</code> table. Each entry in the devices table has an <code>id</code> column. This value is unique - it is an auto-incrementing id.<br><br>When the audit result is processed, each item in each section has its audit result compared to what is in the database.<br><br>For each section, if the key columns (see below table) contain the identical values, it is considered already installed and has its <code>last_seen</code> attribute updated. No change_log entry is created.<br><br>If any of the key columns do not match, it is considered a new attribute and is inserted. A <code>change_log</code> entry is created if the device had other attributes already present in the table.<br><br>At the completion of the audit processing, any database items that have not been updated (or inserted) are considered to not be present. The <code>current</code> attribute for this item is set to <i>n</i> and a change_log entry is generated.<br><br>So, we can determine if something is currently installed - the current column is <i>y</i>.<br><br>We can determine when something was initially detected - the <i>first_seen</i>.<br><br>We can determine if something was installed after the initial audit - first seen will be different in the component and device tables.<br><br>We can determine if something is not currently installed, but previously was - current = <i>n</i>.<br><br>We can determine the last time we detected an item - last_seen.<br><br>At any given point, we can determine what was on a system - by using the audit_log table and selecting the relevant components based on first_seen and last_seen.<br><br>Each section and its matching key columns are below.<br><br>NOTE - There are some exceptions as detailed below.<br><br>*1 - For network cards, if the computer is a VMware Esx machine it also uses the net_index and connection columns.<br><br>*2 - For partitions, f the computer is an AIX machine, we use the partition name.'] = 'Ava- Aud.i havas major шаном un detektomotororon.<br/><br/>Kiam aparato estas revizija, atregultoj estas distitaj en sekciojn kiuj egalrilatas al tabloj en la datummazo.<br/><br/> (+) Europos maisto saugos tarnyba nustatė, kad trūksta tam tikros informacijos apie liekanų tyrimus. <code>devices</code> "Mezcla en la tablo man aparatoj havas" <code>id</code> "Tiu Valoro estestas unika" - "εi estas a septo- inklina id".<br/><br/>Kiam ® reviziorezulto estas prilboreita sekcio havas sian reviziorezulton komparte kun kio estas en la datummazo.<br/><br/>Bendrijoje <code>last_seen</code> Actif à εisdatigita. _ Bendrijoje:<br/><br/>Estette de la esencaj kolonoj ne egalas, εi estas konsiderita nova atigita a kaj estas enigita. Bendrijoje <code>change_log</code> eniro estas kreita se la aparato havis alpijn atrophojn jam nunaj en la tabelo.<br/><br/>Alternatyvi nuoroda <code>current</code> Atritto por titu objektto estas ainacita new <i>Bendrijoje</i> Ranso estas generita.<br/><br/>Tiel, Bendrijoje <i>Bendrijoje</i>Bendrijoje<br/><br/>Thomas povas determi kiam io estis comence detektita - Thomas <i>®</i>Bendrijoje<br/><br/>Bendrijoje <br/><br/>Bendrijoje Roveru io ne estas nuntempe secresetta, sed anta requesterestis... <i>Bendrijoje</i>Bendrijoje<br/><br/>Šio straipsnio 1 ir 2 dalys taikomos mutatis mutandis.<br/><br/>Iu anta.fiksita punkto, Österreipovas determinmi ki estis sur sistemo. utiligante la revizoran tablon kaj selektante la medifajn kompontojn bazitaj sur uua _ visto kaj ultimo _ vidn.<br/><br/> Imitu sekcio kaj... jaj egalaj esencaj kolonoj estas malsupre.<br/><br/>Eksistas kelkaj esceptoj kiel detalaj malsupre Bendrijoje.<br/><br/>Bendrijoje 1 - Por sendostaciaj kartoj, se la komputio estas VMware Esx- marajeino εi ankareazas la tt _ opharm new kajligogolonojn.<br/><br/>2 ';

