$GLOBALS["lang"]['Our new feature called Vulnerabilities gives you the ability to quickly determine if any devices are affected by any CVE (Common Vulnerability Exposure) - but how?<br><br>FirstWave constantly consumes the output from the Nist NVD feed. We take this and apply a few restrictions, then extract the affected programs and build a SQL query for reporting. Your Open-AudIT instance reaches out to FirstWave and requests any new vulnerabilities on a regular basis. When it receives a new vulnerability record, it is run against the database and the result stored. Each time a device is processed, all matching vulnerabilities are again executed and the result stored. This means when viewing a vulnerability list, we do not need to calculate all affected devices - we already have the result. When you view an individual vulnerability record, we do indeed recalculate the result for this singular vulnerability.<br><br>So, you are always up to date!<br><br>In addition to this, we also calculate the result of all vulnerabilities for all devices daily (usually at a quiet time, say 2am).<br><br>In your instance of Open-AudIT, we allow you to select which vendors you care about. i.e. there is no use retrieving vulnerability records from a vendor whose software you do not use or have installed. By default, our vendor list is Adobe, Apple, Cisco, Google, Microsoft, Mozilla, and Redhat.<br><br>This all sounds very simple, but behind the scenes a <b>lot</b> is going on. For instance, the CVE record contains a list of affected software - but those software names do not match what we receive when we audit a computer. A good example is Apache. Typically, a CVE record will say the affected software is http_server. In reality, this appears as apache2 (Ubuntu), httpd (Redhat), Apache HTTP Server (Windows) - and others. So, we have to first determine what is the actual name of the program we receive when we ask a computer, and there may be multiple names. After that we must parse the CVE record and create a matching SQL statement. Allowing for multiple program names as above, and multiple versions, version ranges, and even multiple different pieces of software (an example is Thunderbird and Firefox in a single CVE). And your instance of Open-AudIT must take this and apply Orgs filtering as well. And that is just a single CVE. What about determining which CVEs you have and do not have? What about adding a vendor to the list later? So many things to consider!<br><br>As well as the usual reporting, we also have a few new widgets available for Dashboards, based on Vulnerabilities data.'] = '(RO 2012 7183). Haavvus donas al vi la kapablon faste determinmi... uija paratoj estas trafitaj Fare de iu CVE (Komuna haavatavuse kokkupuude) - sed kiel?<br/><br/>® ® ® ® ® konstante konsumas ® produkta ® prenastion kaj aplikas kelkajn restriktojn, tiam eltiras la trafitajn programmojn kaj konsturas SQL-resistance ® por raportado. (1) 2005 m. sausio 1 d. Šio straipsnio 1 dalyje nurodyta: "Emaj vundeblecoj noveeri besoin efektivititaj kaj la rezulto stokita". (RO 2012 7183). 2015 / 11 / 02 Kiam vi rigardas indiguan vondeblecon, ni efektive rekalkulis la rezulton por tu eksterordinara vondebleco.<br/><br/>"Supply"<br/><br/>Aldone al tio, ni ankarealkalculas la rezulton de... iuj vondeblecoj po...<br/><br/>En kautta kazo de open-, ni permes al vi selekti jiu vendistoj vi sorgas. "Vundekleedikojn de vendisto kies softvaro vi ne uzas a skeptis". Deta.lte next vendristo arba "Adobe" arba "Apple"<br/><br/>Bendrijoje <b>Bendrijoje</b> Bendrijoje La CVE rekordo enhavas listan de trafita softvaro... Sed tiaj softvarnomoj ne egalas kion ni rizvas kiam ni revizias kompution.com - modifictur Fakasht ® tio prezentipriasrer - kajilishij Ni tuhoaa unue determini ko estas la fakta nomo de la programmo kiun ni risovas kiam ni demandas kompetion, kaj povas eksisti multoblaj nomoj. t tio ni murtaa alazi la CVE- rekldon kaj krei egalan SQL - deklaron. Permesado por multoblaj softvaro (eksemplo estas Thunderbird kaj Firefox en ununura CVE). kazo de open- editi preniition kaj apliki neediti filtradon ankadon. Kaj Tio estas nur ununura CVE. Kion vi next kaj ne havas? Kion aldoni vendiston al Bendrijoje? Multaj aferoj.<br/><br/>Mismo kiel la kutima raportado, Indonesia. havas kelkajn novajn vidinad havblajn por ŞBendrijoje, surbaze de Vulnerability datenoj.';

