$GLOBALS["lang"]['Sometimes agentless discovery just does not fit your use-case. Maybe your PCs have tight firewalls. Maybe they are not on the network when your discoveries are scheduled. Maybe they are used by remote workers. Whatever the case, this is where an agent can help. Install it on the target machine and it will <i>check-in</i> with your Open-AudIT server on a schedule and accept tasks. The most common task the server requests is for the agent to audit itself and send the result.'] = 'Foje sensle... nexeltrova... ne konvenas luun uzon. Komputio havas striktajn fejromurojn rev. Eble ili ne estas en la reto kiam viaj malkovroj estas planitaj. Ili estas uzataj establismalreksimaj labaristoj. Nurenajn estas, to estas kie agenteo povas helsi. Instali εin sur neccelma apretino kaj <i>-</i> ® ® ® ® ® ® ® - ® - Servilo en horaro kaj akceptas takojn. Šio straipsnio 1 ir 2 dalyse nurodyti įgaliojimai priimti deleguotuosius aktus Komisijai suteikiami šiame straipsnyje nustatytomis sąlygomis.';

