$GLOBALS["lang"]['Summaries are a single query against the database with a <i>group by</i> command. Using this simple method we can easily create a summary for virtually any attribute.<br><br>We no longer require a separate report for each <i>type</i> of a device. We now simply have a summary that groups by <i>devices.type</i> and shows the result. You can then click on a given type from the list and see the matching devices. In this case, one Summary replaces (potentially) 78 reports (there are 78 device types).<br><br>A summary is different to a query in that a summary is designed to group items by a given attribute then provide a <i>click through</i> link to the actual devices. A query is simply a list of items with no further links. As above - this of a Summary as a combined <i>report + subreport</i>, whereas a query is simply a single Report.<br><br>Summaries have a different collection template to the other resources within Open-AudIT. This template shows the Summary as you would expect and also shows buttons with counts of other resources. This page is designed to be the HomePage of Open-AudIT.'] = 'Résumés estas ununura atendo. <i>-</i> C RomâUzante tiun simplan metodon ni povas reend por practike ajna atantito.<br/><br/>Thomas maximus <i>Bendrijoje</i> (RO 2012 7183). <i>Bendrijoje</i> Kaj montre rezulton. Vi tiam povas klaki sur anta.fiksita tipo de la lista kaj vidi la egalajn aparatojn. Entiu kazo, unu rebo anstata replace Bendrijoje (eble) 78 raportojn (ezistas 78 aparatospecij).<br/><br/>Rezumo estas malsama al esigeo en tio ke regio estas dizajnita por grupigi erojn per antazarfiksita atpero a tiam dispinigas atripezione. <i>-</i> - Ne. Sekva Kielin supre - tio de Resumo kiel Kombinita, Bendrijoje <i>Bendrijoje:</i>Dum atendo estas senillas ununura Raporto.<br/><br/>Résúmenes havas malsaman kolkto apretablon al aliasj resursoj ene de Româopharm. Tiu ðаblono montras la Resumon kiel vi atendus kaj ankai montras butonojn kun kalkuloj de aliasj resursoj. Tiu pa fusiono estas dizajnita por esti la Page d \'accueil de residue';

