$GLOBALS["lang"]['We are often asked this question and the answer most definitely is <i>it depends</i>. It depends on the number of IPs to be scanned, the network connection speed, the speed of the devices being scanned, the type of devices being scanned, the number of different credentials being tested and the speed of the Open-AudIT server. We do not have a calculator that would allow us to input those variables and return a value. It is simply too complex. Generally I limit my discoveries to 256 IP addresses - ie, a /24 subnet. We have had customers scan /16 subnets (65k addresses) and it does work - but it can take a long time. You are much better off scanning in /24 blocks. If you simply do not know what your address ranges are, then this is a good case for a Seed discovery.'] = 'Domida di rilancio kaj lareaktiono pléj sendube estas <i>Bendrijoje</i>(RO 2012 7183). Ni ne avas kalkulilon kiu perflessus al ni enigi tiujn variablojn kaj rendi need. Bendrijoje. Thomas hafvis klientojn sani / 16 subretojn (65k adresoj) kaj εi funkcias - sed εi povas preni longan tempon. Thomas \'agit d\' un programma di formazione à l \'intendation des jeunes. ® vi semplicemente ne scias, kion viaj adresoj estas, tiamtio estas bona kaz por seita malkovro.';

