$GLOBALS["lang"]['When Open-AudIT receives data about a device, either by discovering the device during an audit run or by the user importing the device, it must determine if this discovered device matches a device that already exists within its database, or if it is a new device that should be added. Open-AudIT uses a series of twelve property matches to determine this. The Match Rules work as OR comparisons, not AND. This means the first rule that matches a field in the discovered device to one in the dB resolves as an existing device. All Matching Rules have to fail in order for a device to be new and result in a new record being created.'] = 'Kiam oni malfermis la Ricevas datenojn pri aparato, epäilty malkovrante la aparaton dum reviziokuro epäilty de la uzanto sopportar la aparaton, εi murros determini. Reglamento (ES) Nr. 1308 / 2013 64 straipsnio 1 dalies a punktas Tioung signfas la unuan regulon kiu egalas kampon en la malkovrita aparato al unu en la dB solvas solvas kiel ekistanta aparato. "Sobivad reeglid murtaa malsukcesi por esti nova kaj rezulto en nova reklato estanta kreita".';

$GLOBALS["lang"]['When POSTing data, you must include an access token. An access token is generated with every request type, so make a GET (for example) and Accept: application/json, parse the response for meta→access_token, and include that with your request. This should be placed in the field data[access_token], IE, the top level.'] = 'Kiam Postting datenoj, vi murtaa inkludi alir... Alir Tio devus esti metita en la kampdatenojn [access _ membre], IE, la pintnivelo.';

$GLOBALS["lang"]['When a device is Discovered the audit script will be injected with the file (or directory) details. Both audit_linux.sh and audit_windows.vbs will be populated, regardless of the file path. If you are thinking <i>but putting a Linux path into a Windows machine will break things!</i>, it wont break, you just wont receive any data from that file or directory entry.<br>Retrieved details will be stored in the <i>file</i> database table and are stored like any other attribute. File details will be stored as any other attribute and generate alerts if any of the following attributes change - <i>full_name</i>, <i>hash</i>, <i>inode</i>, <i>last_changed</i>. The table contain a system_id, first_seen, last_seen and current columns as well as the file details.<br>Attributes recorded are:<br><ul><li>Windows - name, size, directory, SHA1 hash (of the file contents), last changed, permissions, owner, version (file permitting).</li><br><li>Linux - name, size, directory, SHA1 hash (of the file contents), last changed, meta data last changed, permissions, owner, group, inode.</li></ul>You will see a section in both the Windows and Linux audit scripts as below'] = 'Kiam aparato estas avastatud la reviziomanuskripto estos injektita kun la dosiero (kahtlus adresaro) detaloj. Hebraziozlin epäilty. sh kaj a défingereddi _ Româopharm vbs estos lo fusionita, nekonsiderante la dosierpado. Bendrijoje <i>Sed meti Linukso- Padon en Vindozo ma apretino retura! ojn!</i>Bendrijoje<br/>Prénitaj detaloj estos stokitaj en la <i>Įtaka</i> Datumbaz kaj estas stocita kiel iu next atiguto. Dosiero detaloj estos stokitaj kiel iu nexy attrattivo kaj suvut errojn se entute de la sekvaj attrattiva <i>Bendrijoje</i>Bendrijoje <i>Bendrijoje</i>Bendrijoje <i>Bendrijoje</i>Bendrijoje <i>Bendrijoje</i>(OL L 20, 2015.1 27, p. 42).<br/>Atributojenever<br/><ul><li>Fenestroj - nomo, grandeco, adresaro, SHA1 hah (de la dosierenhavo), latte деливатитититива, permesojn, posanton, versión (dosiero permesante).</li><br/><li>Linukso - nomo, grandeco, adresaro, SHA1 hah (de la dosierenhavo), latte Ş.ентивалимis, metadatenoj latte ê алеие οилиние, perpesoj, posanto, grupo, indo.</li></ul>Vidos sekcion en kaj la Fenestroj linukso reviziomanuskriptoj Româmalsupre';

