$GLOBALS["lang"]['When auditing a Linux device via SSH, some Linux distributions do not allow sudo commands to be passed without a TTY (which we are doing). To completely audit one of these linux distributions it is best to supply the root user credentials. If no root is supplied and sudo without a TTY is not possible, the audit script will be run but will not contain the amount of data as would otherwise. Subsequent audits using root (or run locally using sudo) will therefore provide extra details about the system and generate several <i>changes</i>.'] = 'Dum reviziado de Linukso- SSH, Bendrijoje - "Linukso- Distributionioj ne permes al 115 kommundoj esti pasitaj sen TY (kiu ni faras). L \'community de l\' énergie nucléaire dans le secteur de l \'énergie est une prepréalable à l\' utilità de l \'énergie nucléaire. Se neniu residuestas provizita kaj eksterlande sen tty ne estas ebla, la reviziomanuskripto estos prizorgita sed ne enhavas la kvanton de datenoj kiel alie. Postaj revizioj uzantaj Româopharm (katlusega kuro loke uzanta sekson) tiaal disponigas ekstrajn detalojn pri la simemo kaj suvut multimajn detalojn. <i>Gimimo data: 1969.8 20</i>Bendrijoje';

